import axios from "axios";

class JwtClient {
    token = "";

    authenticate(username, password) {
        body = {
            username: username,
            password: password,
        };

        axios.post("https://localhost:8443/login", body).then((resp) => {
            console.log(res.data);
        });
    }
}

export default JwtClient;
